function List() {
	const colors = ['red', 'green', 'blue'];
	//const abc = { fontSize: '20px', color: 'red' };
	return (
		<ul>
			{colors.map((color, idx) => (
				<li key={idx} style={{ color: color }}>
					{color}
				</li>
			))}
		</ul>
	);
}

export default List;
